import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {



  return (
    <div className="App">


      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Editing <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
function MovieCounter() {
 const [count, setCount]= useState(0);
 const handleClick= () => setCount(count + 1);

 //const nayoks = [{name:'Rubel', age:27}, {name:'Billal', age:25}, {name:'Alamin', age:20} ,{name:'Shahin', age:15}];


  return(
    <div>

      <button onClick={handleClick} >Add Movie</button>
    <h5>number of movies: {count} </h5>
    <MovieList movie={count}></MovieList>
    <MovieList movie={count + 2}></MovieList>
    <MovieList movie={count + 5}></MovieList>



    </div>
  )

}
function MovieList(props) {
  return <div>
    <h4> the movie list i have acted: {props.movie}</h4> 
  </div>

}

function Nayak(props) {

  const nayakStyle ={border:"2px solid green"};
  return <div style={nayakStyle}>
    <h1>ami sera lazy -{props.name} </h1>
    <h3>tai proja thaki vai - {props.age} </h3>
  </div>

}


export default App;
